import { $authHost, $host } from ".";

export const registration = async (name, surname, email, phone_num, password, permission) => {
    const response = await $host.post('api/users/registration', {name, surname, email, phone_num, password, permission, role: 'ADMIN'})
    return response
}

export const login = async (email, password) => {
    const response = await $host.post('api/users/login', {email, password})
    return response
}

export const check = async () => {
    const response = await $host.post('api/auth/registration')
    return response
}
